import React, { useState, useContext, useEffect } from 'react';

const ProgressCircle = () => {
    return (
        <svg class="progress-ring" width="120" height="120">
            <circle
                class="progress-ring__circle"
                stroke="white"
                stroke-width="4"
                fill="transparent"
                r="52"
                cx="60"
                cy="60"
            />
        </svg>
    );
}

export default ProgressCircle;
